$black: #030303;
$red: #710707;
$gold: #9d8665;


@import 'nulstyle.scss';

/* ============header=============== */
.container {
	max-width: 1470px;
	margin: 0 auto;
	padding: 75px 15px;
}

a {
	text-decoration: none;
	color: white;
}

header {
	width: 100%;
	color: white;
	background-color: $black;
	padding-bottom: 75px;
	.header {
		padding: 0 15px;
		position: relative;
		&__banner {
			display: flex;
			flex-direction: column;
			justify-content: space-between;
		}
		&__menu-container {
			z-index: 9999;
			max-width: 1470px;
			height: 150px;
			display: flex;
			justify-content: space-between;
			align-items: center;
		}
		&__logo {
			font-family: 'Forum';
			font-weight: 400;
			font-size: 28px;
			line-height: 31px;
			letter-spacing: 5px;
			text-transform: uppercase;
			color: #FFFFFF;
			position: relative;
			padding-left: 75px;
			z-index: 1;
			&::before {
				content: "";
				background: url(../assets/logo.png) no-repeat;
				color: #FFFFFF;
				position: absolute;
				width: 100%;
				height: 100%;
				top: 0;
				left: 0;
				z-index:55;
			}
		}
		&__menu {
			max-width: 776px;
			display: flex;
			justify-content: space-between;
			&__list {
				padding-right: 55px;
				font-family: 'Roboto';
				font-weight: 100;
				font-size: 22px;
				line-height: 26px;
				letter-spacing: 2px;
				color: #FFFFFF;
				}
			&__list:last-child {
				padding-right: 0px;
			}
			a {
				transition: 0.5s;
			}
			&__list a:hover {
				color: $gold;
			}
		}
		&__burger {
			display: none;
		}
	}

.banner__container {
	display: flex;
	align-items: center;
	justify-content: space-between;
	height: 750px;
	position: relative;
	picture {
		max-width: 1000px;
		position: absolute;
		top: 0;
		right: 0;
		z-index: 0;
		& img {
			width: 100%;
			object-fit: cover;
			transition: 0.5s ;
		}
}

.banner__text {
	padding-top: 150px;
	max-width: 600px;
	position: absolute;
	top: 0;
	left: 0;
	z-index: 3;
	&__title {
		font-family: 'Forum';
		font-weight: 400;
		font-size: 80px;
		line-height: 90px;
		letter-spacing: 5px;
		text-transform: uppercase;
		color: #FFFFFF;
		margin-bottom: 25px;
		}
	&__subtitle {
		font-family: 'Roboto';
		font-weight: 300;
		font-size: 28px;
		line-height: 33px;
		letter-spacing: 2px;
		color: #FFFFFF;
		margin-bottom: 75px;
	}
	&__button {
		padding: 25px 64px;
		background: $red;
		border-radius: 10px;
		font-family: 'Roboto';
		font-weight: 300;
		font-size: 22px;
		line-height: 26px;
		letter-spacing: 2px;
		color: #FFFFFF;
		transition: 0.7s;

		}
		&__button:hover {
		background: $gold;
		}
		&__button:hover{
			position: relative;
			animation-name: button;
			animation-duration: 1.5s;
			animation-timing-function: linear;
			animation-iteration-count: infinite;
			animation-direction: alternate;
			background: $gold;
		}
	}
}
@keyframes button{
	0%{
	left: 0%;
	}
	100%{
	left: 10%;
	}
	}

	.banner__navigation {
		padding: 15px 55px;
		max-width: 600px; 
		display: flex;
		justify-content: space-between;
		align-items: center;
		font-family: 'Roboto';
		font-weight: 400;
		font-size: 22px;
		line-height: 40px;
		text-transform: uppercase;
		color: #FFFFFF;
		background: $black;
		position: absolute;
		right: 10px;
		bottom: -60px;
		height: 120px;
		z-index: 4;
		&__pages {
			display: flex;
			max-width: 75px;
		}
		&__page1, &__page2 {
			padding-right: 10px ;
		}
		&__page2 {
			padding-left: 10px ;
			border-left: 1px solid white;
		}
		&__dots {
			display: flex;
			justify-content: space-between;
			align-items: center;
			margin: 0 55px;
		}
		&__dot {
			width: 16px;
			height: 16px;
			left: 646px;
			top: 742px;
			background: #FFFFFF;
			margin: 0 15px;
			&:hover {
				background: $gold;
				cursor: pointer;
			}
		}
		&__item {
			height: inherit;
			display: flex;
			align-items: center;
		}
		&__previous {
			width: 30px;
			height: 8px;
			background: url(../assets/previous.png) no-repeat;
			cursor: pointer;
			}
		&__next{
			width: 30px;
			height: 8px;
			background: url(../assets/next.png) no-repeat;
			margin-left: 20px;
			cursor: pointer;
		}
	}
}
/* ============================Visual tour================= */
.tour {
	&__container {	
		display: flex;
		flex-direction: column;
	}
	&__title {
		font-family: 'Forum';
		font-weight: 400;
		font-size: 80px;
		line-height: 90px;
		letter-spacing: 5px;
		text-transform: uppercase;
		color: $gold;
		padding-bottom: 25px;
	}
	&__line {
		max-width: 1470px;
		height: 3px;
		background: $red;
	}
	&__items {
		display: grid;
		grid-template-columns:  repeat(auto-fit, minmax(440px, 1fr));
		column-gap: 60px;
		align-items: center;
		justify-items: center;
	}
	.tour__item {
		display: flex;
		flex-direction: column;
		justify-content: space-between;
		padding-top: 45px;
		margin-top: 45px;
		max-width: 440px;
		transition: 1.0s;
		&:hover {
			transform: scale(1.1);
			box-shadow: 10px 5px 20px $gold;
			cursor: pointer;
		}
		&__title {
			flex-shrink: 1;
			padding-top: 25px;
			font-family: 'Forum';
			font-weight: 400;
			font-size: 32px;
			line-height: 35px;
			letter-spacing: 5px;
			text-transform: uppercase;
			color: $black;
		}
		&__line {
			margin-top: 10px;
			max-width: 300px;
			height: 2px;
			background: $red;
		}
		&__subtitle {
			padding:10px 0;
			font-family: 'Roboto';
			font-weight: 100;
			font-size: 22px;
			line-height: 26px;
			color: $black;
		}
	}
	.tour__item img{
		width: 100%;
		object-fit: cover;
	}
}

/* ===========================explore======================== */
.explore {
	background-color: $black;
	color: white;
	&__container{
		display: grid;
		grid-template-columns:  repeat(2, minmax(440px, 1fr));
		align-items: center;
		justify-items: center;
	}
	&__text {
		max-width: 660px;
	}
	&__text__title {
		font-family: 'Forum';
		font-weight: 400;
		font-size: 80px;
		line-height: 90px;
		letter-spacing: 5px;
		text-transform: uppercase;
		color: #FFFFFF;
		padding-bottom: 25px;
	}
	&__text__line {
		max-width: 660px;
		height: 3px;
		background: $red;
		border-radius: 0px;
		margin-bottom: 75px;
	}
	&__text__subtitle {
		font-family: 'Roboto';
		font-weight: 300;
		font-size: 22px;
		line-height: 38px;
		color: #FFFFFF;
	}
	&__text__subtitle p {
		margin-bottom: 25px;
	}
}

.explore__img {
	max-width: 720px;
	position: relative;
	top: 0;
	left: 0;
	z-index: 6;
	margin-left: 15px;
	&::before {
		content: "";
		position: absolute;
		top: 0;
		left: 0;
		background: url(../assets/explore_2.png) 0 0/contain no-repeat;
		width: 100%;
		height: 100%;
		z-index: 55;
	}
	&::after {
		content: "";
		position: absolute;
		top: 0;
		left: 59%;
		background: url(../assets/explore_slider.png) 0 0/contain no-repeat;
		width: 40px;
		height: 100%;
		z-index: 55;
		max-width: 720px;
		cursor: pointer;
	}
	
}
.explore__img img {
	object-fit: cover;
	width: 100%;
	height: 100%;
}

/* ===================================video========================= */
.journey {
	&__text {
		display: flex;
		justify-content: space-between;
		padding-bottom: 75px;
	}
	&__title {
		max-width: 605px;
		font-family: 'Forum';
		font-weight: 400;
		font-size: 80px;
		line-height: 90px;
		text-transform: uppercase;
		color: $gold;
	}
	&__subtitle {
		max-width: 720px;
		font-family: 'Roboto';
		font-weight: 300;
		font-size: 22px;
		display: flex;
		align-items: center;
		color: #000000;
	}

	&__mainvideo {
		align-self: center;
		padding-bottom: 56%;
		position: relative;
		margin-bottom: 40px;
	}
	&__mainvideo iframe {
		position: absolute;
		top: 0;
		left: 0;
		object-fit: cover;
		height: 100%;
		width: 100%;
	}
	
	&__secondaryvideo {
		display: grid;
		grid-template-columns: repeat(auto-fit, minmax(290px, 1fr));
		gap: 40px;
	}
	
	.secondaryvideo {
		padding-bottom: 56%;
		position: relative;
	}
	.journey__secondaryvideo iframe {
		position: absolute;
		top: 0;
		left: 0;
		object-fit: cover;
		height: 100%;
		width: 100%;
	}
}

		.video__navigation {
			margin-top: 40px;
			display: flex;
			justify-content: center;
			position: relative;
			&__stroke{
				padding: 0 10px;
			}
			&__dot {
			display: inline-block;
			width: 12px;
			height: 12px;
			border-radius: 50%;
			background: #999999;
			margin: 0px 10px;

			&:hover {
				background: $gold;
				cursor: pointer;
			}
		}
	}


/* ======================================gallery=============== */
.gallery {
	background: $black;
	&__container{
		height: 2290px;
		overflow: hidden;
	}
	&__title {
		font-family: 'Forum';
		font-weight: 400;
		font-size: 80px;
		line-height: 90px;
		letter-spacing: 5px;
		text-transform: uppercase;
		color: #FFFFFF;
		padding-bottom: 75px;
	}
	&__img{
		display: grid;
		align-items: center;
		justify-content: center;
		grid-template-columns:  repeat(auto-fit, minmax(456px, 1fr));
		row-gap: 24px;
		column-gap: 30px;
		align-items: center;
		justify-items: center;
	}
	&__img div {
		max-width: 456px;
	}
	&__img img {
		width: 100%;
		object-fit: cover;
	}
}

/* ===================================form tickets======== */
.form {
	&__title{
		font-family: 'Forum';
		font-weight: 400;
		font-size: 80px;
		line-height: 90px;
		letter-spacing: 5px;
		text-transform: uppercase;
		color: #9D8665;
	}
	&__line {
		margin-top: 10px;
		margin-bottom: 75px;
		max-width: 1470px;
		height: 2px;
		background: $red;
		border-radius: 0px;
		}
}

.form__buy {
	display: flex ;
	justify-content: space-between;
	&__img {
		max-width: 720px; 
	}
	&__img img {
		width: 100%; 
		object-fit: cover;
	}
}
	
.form__tickets {
	max-width: 690px;
	display: flex;
	justify-content: space-between;
	padding-left: 15px;
}

.form__radio__radio {
	margin-bottom: 25px;
}

.checkbox__label {
	font-family: 'Roboto';
	font-style: normal;
	font-weight: 300;
	font-size: 22px;
	line-height: 26px;
	color: #000000;
}
.form__radio__title, .form__amount__title {
	font-family: 'Roboto';
	font-weight: 700;
	font-size: 28px;
	line-height: 33px;
	color: #000000;
}

.form__amount {
	display: flex;
	flex-direction: column;
	justify-content: flex-end;
}

.form__radio__title  {
	margin-bottom: 50px;
}

.form__amount__title  {
	align-self: flex-end;
	margin-bottom: 25px;
}

.checkbox {
	position: relative;
}

.checkbox__input {
display: none;
}
.checkbox__label {
	padding: 8px 245px 0 45px;
	position: relative;
}
.checkbox__label::before {
	content: "";
	position: absolute;
	z-index: 3;
	top: 14px;
	left: 0;
	width: 17px;
	height: 17px;
	border-radius: 50%;
	border: 2px solid #000000;
	box-sizing: border-box;
} 

.checkbox__label::after{
	content: "";
	position: absolute;
	z-index: 4;
	width: 7px;
	height: 7px;
	left: 5px;
	top: 19px;
	border-radius: 50%;
	background: #000000;
		opacity: 0;
}

.checkbox__input:checked + .checkbox__label::after {
	opacity: 1;
}

.form__amount__age18,
.form__amount__age65 {
	font-family: 'Roboto';
	font-weight: 300;
	font-size: 22px;
	line-height: 26px;
	color: #000000;
}

.form__amount__number {
	display: flex;
	justify-content: center;
	align-items: center;
	width: 100%;
	height: 50px;
	border: 3px solid #000000;
	box-sizing: border-box;
	border-radius: 0px;
	position: relative;
	margin-bottom: 20px;
	&::before {
		content: "";
		background: url(../assets/minus.png) center no-repeat;
		top: 5px;
		left: 0;
		width: 38px;
		height: 38px;
		position: absolute;

	}
	&::after {
		content: "";
		background: url(../assets/plus.png) center no-repeat;
		top: 5px;
		right: 0;
		width: 38px;
		height: 38px;
		position: absolute;
	}
}

.form__amount__price {
	font-family: 'Roboto';
	font-weight: 700;
	font-size: 28px;
	line-height: 33px;
	letter-spacing: 1.65px;
	color: $black;
	margin-top: 50px ;
}

.form__amount__button {
	margin-top: 60px ;
	display: flex;
	justify-content: center;
	align-items: center;
	width: 100%;
	height: 50px;
	left: 0px;
	top: 0px;
	background: $black;
	border-radius: 2px;
	font-family: 'Roboto';
	font-weight: 300;
	font-size: 22px;
	line-height: 26px;
	display: flex;
	align-items: center;
	text-align: center;
	letter-spacing: 2px;
	color: #FFFFFF;
	padding: 0 15px;
	transition: 0.5s;
	&:hover {
		background: $gold;
		color: $black;
		cursor: pointer;
	}
}

/* =====================parallax================ */
.parallax {
	width: 100%;
	img {
		width: 100%;
		object-fit: cover;
	}
}

/* ==============contacts================== */
