			max-width: 300px;
			font-family: 'Roboto';
			font-weight: 300;
			font-size: 22px;
			line-height: 26px;
			color: $black;
			padding-bottom: 25px;
		}
		&__map {
			max-width: 960px;
			margin-bottom: 75px;
			margin-left:15px
		}

		&__map img {
			width: 100%;
			object-fit: cover;
		}
	}

	/* =========================footer================ */
footer {
	background: $black;
}
	.footer__navigation{
		border-bottom: 3px solid #666666;
		&__container {
			padding: 75px 15px 60px 15px;
			display: flex;
			justify-content: space-between;
