@media (max-width:1024px) {
	header {
		padding-bottom: 0;
		.header {
			display: flex;
			flex-direction: column;
			&__menu-container {
				position: relative;
				top: 0;
				left: 0;
				padding: 0px;
				height: 130px;
				z-index: 100;
			}
			&__menu {
				display: none;
				&__list {
					height: inherit;
					padding: 40px 55px;
				}
			}
			&__burger {
			display: block;
			position: absolute;
			top: 38%;
			right: 0;
			width: 30px;
			height: 20px;

			&::before{
				content: "";
				background-color: white;
				position: absolute;
				width: 100%;
				height: 2px;
				left: 0;
				top: 0;
			}
			&:after{
				content: "";
				background-color: white;
				position: absolute;
				width: 100%;
				height: 2px;
				left: 0;
				bottom: 0;
				}
				& span {
					position: absolute;
					background-color: white;
					left: 0;
					top: 0;
					width: 100%;
					height: 2px;
					top: 9px;
				}

				.second-menu{
					border-radius: 5px;
